import "./Hero.css"


const Hero: React.FC = ()=> {
    return (
        <div id="hero-container">
                <div id="hero-search">
                    <p id="hero-search-text">Epicure works with the top chef restaurants in Tel Aviv</p> 
                    <div id="hero-search-input">
                        {/* <img src = alt="hero-search-image" /> */}
                        <input type="text" src={Searchicon} placeholder="Search for restaurant cuisine, chef" id="hero-input-text"/>

                    </div>

                </div>            
        </div>
    ) 
}

export default Hero as React.FC;
